import React from 'react';
import Lettering from '../components/lettering';
import Slide from '../components/slide';
import './slider.css';

export const foo = 'baa';

export const media = [
  {
    slug: '',
    className: 'slide page-one',
    children: (
      <Lettering
        title="INDEX"
        text={[
          'Corrigir navegacao pulsante ao trocar de link no final da mesma.',
        ]}
      />
    ),
  },
  {
    slug: 'page-two',
    className: 'slide page-two',
    children: <Lettering title="PAGE-TWO" />,
  },
  {
    slug: 'page-three',
    className: 'slide page-three',
    children: <Lettering title="PAGE-THREE" />,
  },
];
